@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {

}
<form  method="post">
  <h2>Jelentkezz be!</h2>
  <div><input type="text" name="email" placeholder="E-mail" class="textinput"/></div>
  <div><input type="password" name="password" placeholder="Jelszó" class="textinput"/></div>
  <div><input type="submit" value="Bejelentkezés" class="button" routerLink="/items"/></div>
</form>
